//       window.sessionStorage.setItem("userId",1);
//       window.sessionStorage.setItem("userName","Doctor");
//       history.push('/DoctorHome');
//   }
//     else{
//       setError("Enter valide Details First");
//       window.setTimeout(()=>{
//         setError("");
//       },5000);
//       }
//     }



//Permenent
    const signIn=()=>{
        if(Email!=""&&Password!=""){
          const helper=new XMLHttpRequest();
          helper.onreadystatechange=()=>{
            if(helper.status==200&&helper.readyState==4){
              let data1=JSON.parse(helper.responseText);
              if(Object.keys(data1).length === 0){

                const helper=new XMLHttpRequest();
                helper.onreadystatechange=()=>{
                  if(helper.status==200&&helper.readyState==4){
                    let data2=JSON.parse(helper.responseText);
                    if(Object.keys(data2).length === 0){

                      const helper=new XMLHttpRequest();
                      helper.onreadystatechange=()=>{
                        if(helper.status==200&&helper.readyState==4){
                          let data3=JSON.parse(helper.responseText);
                          if(Object.keys(data3).length === 0){

                            setError("Invalide User Name and Password");
                            window.setTimeout(()=>{
                              setError("");
                            },5000); 

                          }
                          else{
                            sessionStorage.setItem("isLoggedIn","true");
                            window.sessionStorage.setItem("userId",data3[0].id);
                            window.sessionStorage.setItem("userName",data3[0].firstName);
                            history.push('/DoctorHome');
                            }
                        }
                      }
                      helper.open('GET',"http://localhost:7070/patient/loginDoctor/"+Email+"/"+Password);
                      helper.setRequestHeader("Content-Type","application/json");
                      helper.send();

                    }
                    else{
                      sessionStorage.setItem("isLoggedIn","true");
                      window.sessionStorage.setItem("userId",data2[0].id);
                      window.sessionStorage.setItem("userName",data2[0].hospitalName);
                      history.push('/HospitalHome');
                      }
                  }
                }
                helper.open('GET',"http://localhost:7070/patient/loginHospital/"+Email+"/"+Password);
                helper.setRequestHeader("Content-Type","application/json");
                helper.send();
              }
              else{
                sessionStorage.setItem("isLoggedIn","true");
                window.sessionStorage.setItem("userId",data1[0].id);
                window.sessionStorage.setItem("userName",data1[0].firstName);
                history.push('/');
                }
            }
          }
          helper.open('GET',"http://localhost:7070/patient/loginPatient/"+Email+"/"+Password);
          helper.setRequestHeader("Content-Type","application/json");
          helper.send();
        }
        else{
          setError("Enter Details First");
          window.setTimeout(()=>{
            setError("");
          },5000);
        }
    }

    const register=()=>{
      debugger;
      history.push('/register')
    }

    return ( 
        <>
        <center>
            <br/><br/><br/><br/><br/><br/><br/>
        <div style={{width:400}}>
                <main class="form-signin w-100 m-auto">
    <h1 class="h3 mb-3 fw-normal">sign in</h1>

    <div class="form-floating">
      <input type="email" class="form-control" id="floatingInput" name="Email" placeholder="name@example.com" value={Email} onChange={set1}/>
      <label for="floatingInput">Email address</label>
    </div>
    <br></br>
    <div class="form-floating">
      <input type="password" class="form-control" id="floatingPassword" name="Password" placeholder="Password" value={Password} onChange={set2}/>
      <label for="floatingPassword">Password</label>
    </div>

    <div class="form-check text-start my-3">
      <input class="form-check-input" type="checkbox" value="remember-me" id="flexCheckDefault"/>
      <label class="form-check-label" for="flexCheckDefault">
        Remember me
      </label>
    </div>
    <button class="btn btn-primary w-100 py-2" onClick={signIn}>Sign in</button>
    <br></br>
    <br></br>
    <div className="table-responsive">
      <table className="table">
        <tr>
          <td>
            <h4>Don't have account? </h4>
          </td>
          <td>
            <button class="btn btn-primary w-100 py-2" onClick={register}>Register</button>
          </td>
        </tr>
      </table>
    </div>

    <br/><br/>
    <div style={{color:'red'}}>{error}</div>
</main>
</div>
</center>
        </>
     );

}
export default Login;
